source.buildSpec:
{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "npm install -g aws-cdk"
      ]
    },
    "build": {
      "commands": [
        "ls",
        "cd infrastructure",
        "python -m pip install -r requirements.txt",
        "cdk synth"
      ]
    }
  },
  "artifacts": {
    "base-directory": "infrastructure/cdk.out",
    "files": "**/*"
  }
}
